import { useHistory } from 'react-router-dom';

export default function Logout() {
    const history = useHistory();
    this.props.setUserData({
        token: undefined,
        user: undefined
    })
    localStorage.setItem("auth-token", "");
    history.push("/");
    window.location.reload(false);
}

