import React from 'react';
import Bug from '../../models/Bug';
import jwtDecode from 'jwt-decode';
import axios from 'axios';
import BugPreview from './BugPreview'
import { Link } from 'react-router-dom';
class MyBugs extends React.Component {
    state = { bugs: null };

    componentDidMount() {
        let token = localStorage.getItem("auth-token");
        axios.get('/api/myBugs', { headers: { "x-auth-token": token } })
            .then(res => {
                this.setState({ bugs: res.data })
            })
    }
    render() {
        if (this.state.bugs != null) {
            return (
                <div>
                    <ul>
                        <li><Link to="/bugs/myCreatedBugs">My Created Bugs</Link></li>
                        <li><Link to="/bugs">All Bugs</Link></li>
                        <li><Link to="/bugs/myAssignedBugs">My Assigned Bugs</Link></li>
                    </ul>
                    {this.state.bugs.map(bug => {
                        return <BugPreview key={bug._id} {...bug} />
                    })}
                </div>
            )
        }
        else {
            return <div>You need to log in to be able to see your bugs.
                <Link to="/login"> Log in</Link>
            </div>
        }
    }
}

export default MyBugs;

