import { MongoClient, ObjectID } from 'mongodb';
import express from 'express';
import Issue from '../models/Issue';
import User from '../models/User';
const auth = require('../middleware/auth');
const router = express.Router();
router.use(express.urlencoded({ extended: false }));
router.use(express.json());
import jwtDecode from 'jwt-decode';

router.get('/', auth, (req, res) => {
    Issue.find({}, (err, docs) => {
      res.send(docs)
    })
  });

  router.get('/myCreatedIssues', auth, (req, res) => {
    let token = req.header("x-auth-token");
    let decoded = jwtDecode(token);
    Issue.find({reporterId: decoded.id}, (err, docs) => {
      res.send(docs);
    })
  })

  router.get('/myAssignedIssues', auth, (req, res) => {
    let token = req.header("x-auth-token");
    let decoded = jwtDecode(token);
    Issue.find({assignedToId: decoded.id}, (err, docs) => {
      res.send(docs);
    })
  })

  router.get('/:issueId', auth, (req, res) => {
    Issue.findById(`${req.params.issueId}`, (err, doc) => {
      res.send(doc)
    })
  });

  router.post('/', auth, (req, res) => {
    let token = req.header("x-auth-token");
    let decoded = jwtDecode(token);
    User.findOne({name: req.body.assignedTo}, (err, doc) => {
      var newIssue = new Issue({
        title: req.body.title,
        description: req.body.description,
        assignedToId: doc._id,
        priority: req.body.priority,
        reporterId: decoded.id,
        status: req.body.status,
        dateCreated: req.body.dateCreated
      }) 
      newIssue.save()
    })
  })

  router.post('/updateIssue/:issueId', auth, (req, res) => {
    Issue.findByIdAndUpdate(`${req.params.issueId}`, {status: "In Progress"}, (err, doc) => {
      res.send(doc)
    })
  })

  router.post('/delete/:issueId', auth, (req, res) => {
    Issue.findByIdAndDelete(`${req.params.issueId}`, (err, doc) => {
      res.send(doc);
    })
  })

  router.post('/editIssue/:issueId', auth, (req, res) => {
    Issue.findByIdAndUpdate(`${req.params.issueId}`, {title: req.body.title, description: req.body.description,
    assignedToId: req.body.assignedToId, priority: req.body.priority, reporterId: req.body.reporterId, status: req.body.status, dateCreated: req.body.dateCreated}, (err, doc) => {
     res.send(doc);
    })
  })

  export default router;

