const mongoose = require('mongoose');
const Schema = mongoose.Schema;

const IssueSchema = new Schema({
    title: {
        type: String,
        required: true
    },
    description: {
        type: String,
        required: true
    },
    assignedToId: {
        type: String,
        required: true
    },
    priority: {
        type: String,
        required: true
    },
    status: {
        type: String,
        required: true
    },
    reporterId: {
        type: String,
        required: true 
    },
    dateCreated: {
        type: Date,
        default: Date.now
    }
})

var Issue = mongoose.model('Issue', IssueSchema);
module.exports = Issue;

