import React, { Component } from 'react';
import ReactDOM from 'react-dom';
import PropTypes from 'prop-types';
import BugPreview from './BugPreview';
import Bug from './Bug';
import axios from 'axios';
import * as api from '../api';
import { Router, Route, Link, Switch } from 'react-router-dom';
import IssuePreview from './IssuePreview';

class IssueList extends Component {

  render() {
    if (this.props.issues != null) {
      return (
        <div>
          <ul className="bugKinds">
            <li><Link to="/issues/myCreatedIssues">My Created Issues</Link></li>
            <li><Link to="/issues">All Issues</Link></li>
            <li><Link to="/issues/myAssignedIssues">My Assigned Issues</Link></li>
          </ul>
          {
        this.props.issues.map(issue => (
          <IssuePreview key={issue._id} {...issue} />
        ))
          }
        </div>
    )
    }
    else {
      return <div>
        You need to be logged in to see the issue list.
        <Link to="/login"> Log in</Link>
        </div>

    }
  }
  
}

IssueList.propTypes = {
  issues: PropTypes.array
}

export default IssueList;

