import React, { Component } from 'react';
import PropTypes from 'prop-types';
import axios from 'axios';
import jwtDecode from 'jwt-decode';
import { Redirect } from 'react-router-dom';
class Issue extends Component {

  editIssue = () => {
    this.setState({redirect: true})
  }

  updateIssue = () => {
    let token = localStorage.getItem("auth-token");
    axios.post(`/api/issues/updateIssue/${this.state.issue._id}`, null, {headers: {"x-auth-token": token}} )
    .then(window.location.reload(false))
  }
       
  state = { issue: null, redirect: false }
  componentDidMount() {
    let token = localStorage.getItem("auth-token");
    axios.get(`/api/issues/${this.props.match.params.issueId}`, { headers: { "x-auth-token": token } })
      .then(res => {
        this.setState({ issue: res.data, redirect: false });
      })
  }
  render() {
    if (this.state.redirect) {
      return <Redirect to={`/issue/edit/${this.state.issue._id}`} push={true}/>
    }
    if (this.state.issue != null) {
      let token = localStorage.getItem("auth-token");
      let decoded = jwtDecode(token);
        return (
          <div className="bugTable">
            {decoded.id === this.state.issue.assignedToId && this.state.issue.status === 'Open' ? 
            <div className="homeParagraph"><br/><h3>Start working on this issue?</h3>
            <button onClick={this.updateIssue}className="yesNo">Start</button></div> : null}
            <table>
              <tbody>
                <tr>
                  <th>Name</th>
                  <td>{this.state.issue.title}</td>
                </tr>
                <tr>
                  <th>Description</th>
                  <td>{this.state.issue.description}</td>
                </tr>
                <tr>
                  <th>Assigned To Id</th>
                  <td>{this.state.issue.assignedToId}</td>
                </tr>
                <tr>
                  <th>Priority</th>
                  <td>{this.state.issue.priority}</td>
                </tr>
                <tr>
                  <th>Status</th>
                  <td>{this.state.issue.status}</td>
                </tr>
                <tr>
                  <th>Reporter Id</th>
                  <td>{this.state.issue.reporterId}</td>
                </tr>
                <tr>
                  <th>Date Created</th>
                  <td>{this.state.issue.dateCreated}</td>
                </tr>
              </tbody>
            </table>
            {decoded.id === this.state.issue.assignedToId || decoded.id === this.state.issue.reporterId ?
            <div><br/><button onClick={this.editIssue} className="editButton">Edit Issue</button></div> : null}
          </div>
        );
      }
    
    else {
      return <div></div>
    }
  }
}


// Bug.propTypes = {
//   _id: PropTypes.string.isRequired,
//   description: PropTypes.string.isRequired,
//   bugListClick: PropTypes.func.isRequired,
// };

export default Issue;

