import React from 'react';
import Issue from '../../models/Issue';
import jwtDecode from 'jwt-decode';
import axios from 'axios';
import IssuePreview from './IssuePreview'
import { Link } from 'react-router-dom';
class MyCreatedIssues extends React.Component {
    state = { issues: null };

    componentDidMount() {
        let token = localStorage.getItem("auth-token");
        axios.get('/api/issues/myCreatedIssues', { headers: { "x-auth-token": token } })
            .then(res => {
                this.setState({ issues: res.data })
            })
    }
    render() {
        if (this.state.issues != null) {
            return (
                <div>
                    <ul className="bugKinds">
                        <li><Link to="/issues/myCreatedIssues">My Created Issues</Link></li>
                        <li><Link to="/issues">All Issues</Link></li>
                        <li><Link to="/issues/myAssignedIssues">My Assigned Issues</Link></li>
                    </ul>
                    {this.state.issues.map(issue => {
                        return <IssuePreview key={issue._id} {...issue} />
                    })}
                </div>
            )
        }
        else {
            return <div>You need to log in to be able to see your issues.
                <Link to="/login"> Log in</Link>
            </div>
        }
    }
}

export default MyCreatedIssues;

