    },
    assignedToId: {
        type: String,
        required: true
    },
    priority: {
        type: String,
        required: true
    },
    status: {
        type: String,
        required: true
    },
    reporterId: {
        type: String,
        required: true 
    },
    dateCreated: {
        type: Date,
        default: Date.now
    },
    dateModified: {
        type: Date,
        default: Date.now
    }
})

var Task = mongoose.model('Task', TaskSchema);
module.exports = Task;

